////import { Helmet } from 'react-helmet-async';
import PageTitle from '../../../../components/PageTitle';
import { useState } from 'react';

import PageTitleWrapper from '../../../../components/PageTitleWrapper';
import { Button, IconButton, Container, Grid, Card, CardHeader, CardContent, Divider } from '@mui/material';
import Footer from '../../../../components/Footer';

import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import { pink } from '@mui/material/colors';
import Checkbox from '@mui/material/Checkbox';

import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';

import Stack from '@mui/material/Stack';
import Slider from '@mui/material/Slider';
import VolumeDown from '@mui/icons-material/VolumeDown';
import VolumeUp from '@mui/icons-material/VolumeUp';

import Switch from '@mui/material/Switch';

const label = { inputProps: { 'aria-label': 'Switch demo' } };

const currencies = [
    {
        value: 'USD',
        label: '$',
    },
    {
        value: 'EUR',
        label: '€',
    },
    {
        value: 'BTC',
        label: '฿',
    },
    {
        value: 'JPY',
        label: '¥',
    },
];

function Forms() {

    const [currency, setCurrency] = useState('EUR');

    const handleChange = (event) => {
       // setCurrency(event.target.value);
    };

    const [value, setValue] = useState(30);

    const handleChange2 = (event, newValue) => {
        setValue(newValue);
    };


    return (
        <>

            
            <Container maxWidth="sm">
                <PageTitleWrapper>
                    <PageTitle
                        heading="Login"
                        subHeading="sers."
                    />
                </PageTitleWrapper>
                <Grid
                    container
                    direction="row"
                    justifyContent="center"
                    alignItems="stretch"
                    spacing={6}
                >
                    <Grid item xs={12}>
                        <Card sx={{ px: 12 }}>
                            <CardHeader title="Enter Credentials" />
                            <Divider />
                            <CardContent>
                                <Box
                                    component="form"
                                    sx={{
                                        '& .MuiTextField-root': { m: 1, width: '25ch' },
                                    }}
                                    noValidate
                                    autoComplete="off"
                                >
                                    <div>
                                        <TextField
                                            style={{ width: '100%' }} value={value} onBlur={handleChange }
                                            required
                                            id="outlined-required"
                                            label="Username"
                                        />
                                    </div>
                                    <div>
                                        <TextField style={{ width: '100%' }} required 
                                            id="outlined-password-input"
                                            label="Password" value={value}
                                            type="password"
                                            autoComplete="current-password"
                                        />
                                    </div>
                                   
                                    <Button sx={{ margin: 1 }} variant="contained" color="primary">
                                        Login
                                    </Button>
                                </Box>
                            </CardContent>
                        </Card>
                    </Grid>
                </Grid>
                <Footer />
            </Container>
           
        </>
    );
}

export default Forms;
